import React, { useState, useEffect } from 'react';

function Predictions() {
  const [predictions, setPredictions] = useState([]);
  const [filteredPredictions, setFilteredPredictions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');

  const API_URL = 'http://localhost:3001'; // Ensure this matches your backend

  useEffect(() => {
    fetchPredictions();
  }, []);

  const fetchPredictions = async () => {
    try {
      setLoading(true);
      setError(null);
      const response = await fetch(`${API_URL}/api/latest-predictions`);
      if (!response.ok) throw new Error('Failed to fetch predictions');
      const result = await response.json();
      const data = Array.isArray(result.data) ? result.data : [];
      setPredictions(data);
      setFilteredPredictions(data);
    } catch (error) {
      console.error('Error:', error);
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = (e) => {
    const keyword = e.target.value.toLowerCase();
    setSearchTerm(keyword);

    if (!keyword) {
      setFilteredPredictions(predictions);
      return;
    }

    const filtered = predictions.filter((row) =>
      Object.values(row).some(
        (value) => value && value.toString().toLowerCase().includes(keyword)
      )
    );
    setFilteredPredictions(filtered);
  };

  return (
    <div className="page-container" style={{ padding: '20px' }}>
      <h1>Databricks Predictions</h1>
      {error && <div className="error-message" style={{ color: 'red' }}>Error: {error}</div>}

      <input
        type="text"
        placeholder="ðŸ” Search by any keyword..."
        value={searchTerm}
        onChange={handleSearch}
        style={{
          padding: '10px',
          width: '100%',
          maxWidth: '400px',
          marginBottom: '20px',
          fontSize: '16px'
        }}
      />

      {loading ? (
        <p>Loading...</p>
      ) : filteredPredictions.length === 0 ? (
        <p>No matching predictions found</p>
      ) : (
        <div className="content-section">
          <table border="1" cellPadding="8" style={{ borderCollapse: 'collapse', width: '100%' }}>
            <thead>
              <tr>
                {Object.keys(filteredPredictions[0]).map((key) => (
                  <th key={key}>{key.toUpperCase()}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {filteredPredictions.map((row, index) => (
                <tr key={index}>
                  {Object.values(row).map((value, i) => (
                    <td key={i}>{value}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default Predictions;
